import React from "react";

function Resultpage(props) {
  let score = props.location.state.score;
  const ans = props.location.state.ans;
  const res = props.location.state.res;
  if (ans === res) {
    score = score + 1;
  }
  console.log(ans, res, score);
  return (
    <div className="container">
      <div className="box1">
        <h1>Your Score : {score}</h1>
        {score > 1 ? <h1>Passed</h1> : <h1>Fail</h1>}
      </div>
    </div>
  );
}

export default Resultpage;
